glass.Fill(200);
Console.WriteLine("Current Capacity: " + glass.currentCapacity);
Console.WriteLine("Is Full: " + glass.IsFull());
Console.WriteLine("Is Empty: " + glass.IsEmpty());
Console.WriteLine("Percentage Full: " + glass.GetPercentageFull());
glass.Empty();
Console.WriteLine("Current Capacity: " + glass.currentCapacity);
```
